import React from 'react';
import './HomePage.css';
import donboloImage from '../assets/images/imagen4.jpg';

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Sección de imagen del evento */}
      <div className="event-section">
        <img
          src={donboloImage}
          alt="Evento principal"
          className="event-image"
        />
        <div className="event-overlay">
          <h1>Evento Principal</h1>
          <p>¡No te pierdas este gran evento!</p>
        </div>
      </div>

    </div>
  );
};

export default HomePage;
